import React from 'react'
import s from './ProductCard.module.css'
import { Link } from 'react-router-dom'

export default function ProductCard({title, price, description, image, id}) {

  return (
    <Link className={s.card} to={`/products/${id}`}>
      {/* <div style={{backgroundImage: `url(http://localhost:3333${image})`, backgroundSize: 'cover'}} className={s.products_card_img} /> */}
      <img src={`http://localhost:3333${image}`} alt={title} />
      <h6 className={s.card_title}>{title}</h6>
      <div className={s.card_price}>${price}</div>
    </Link>
  )
}
